import React, {Fragment} from 'react';
import {Link} from 'react-router-dom';

const Navbar = () => {
    return (
        <nav className="navbar-backgroundnavbar navbar-light bg-light justify-content-between">
            <h1>
                <Link to='/'>
                    <i/>Llamas
                </Link>
            </h1>
        </nav>
    );
}

export default Navbar;
